contents:
저능 레이첼 바이스 ㅠㅠㅠㅠ 와이즈로 알고있었는데 바이스로 불리길 원한대서;;
미이라에서부터 제 마음을 앗아간 언니입니다.....
남편도 핵멋짐 ㅠ 사실 007로 알고있는 사람 많겟지만 그전에 니콜 키드먼이랑 찍은 영화보고 핵반함

이번달 영화 두편 무료라서 고르는데 
미이라  트랜스포머5 이렇게 봐야하나 ㅇㅁㅇ
...뭔가 라인업이;;

어렸을 때 내가 공포물이라고 생각 한 것 : 
영화 미이라

사람 몸 안에 벌레 수십마리 들어가서 꿈틀거리는 장면이나 미라가 일어나는 장면은 6살 때 이후로 줄곧 트라우마였는데 성인되어서 다시 보니 신나는 모험 활극 !!~~~ 이런거라 너무 놀램;;
